import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-b5d7c2e6c32eb",
    path: "/javascript/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/xiangliu/Downloads/front-end-notebook/docs/javascript/readme.md").then(comp => {
        Vue.component("v-b5d7c2e6c32eb", comp.default)
        next()
      })
    }
  },
  {
    path: "/javascript/index.html",
    redirect: "/javascript/"
  },
  {
    name: "v-6a027c956c99e",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/xiangliu/Downloads/front-end-notebook/docs/readme.md").then(comp => {
        Vue.component("v-6a027c956c99e", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
